// src/App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import DoctorList from './components/sections/DoctorList';
import CreateDoctor from './components/sections/CreateDoctor';

function App() {
  const [doctors, setDoctors] = useState([]);

  const addDoctor = (newDoctor) => {
    setDoctors([...doctors, newDoctor]);
  };

  return (
    <Router>
      <Routes>
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/doctorlist" element={<DoctorList doctors={doctors} />} />
        <Route path="/createdoctor" element={<CreateDoctor addDoctor={addDoctor} />} />
      </Routes>
    </Router>
  );
}

export default App;
